const e=JSON.parse('{"key":"v-359d8b3d","path":"/collection/Linux.html","title":"Linux常用命令积累","lang":"zh-CN","frontmatter":{"title":"Linux常用命令积累","shortTitle":"Linux常用命令","isOriginal":true,"sticky":true,"star":true,"timeline":true,"category":["十年磨剑"],"tag":["十年磨剑"],"description":"课下点滴积累","head":[["meta",{"name":"keywords","content":"Linux,Docker,Linux常用命令,docker常用命令,FireWall常用命令"}],["meta",{"property":"og:url","content":"https://wlei224.gitee.io/collection/Linux.html"}],["meta",{"property":"og:site_name","content":"CS_GUIDER"}],["meta",{"property":"og:title","content":"Linux常用命令积累"}],["meta",{"property":"og:description","content":"课下点滴积累"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-04-30T01:56:23.000Z"}],["meta",{"property":"article:author","content":"WLei224"}],["meta",{"property":"article:tag","content":"十年磨剑"}],["meta",{"property":"article:modified_time","content":"2023-04-30T01:56:23.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"Linux常用命令积累\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-04-30T01:56:23.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"WLei224\\",\\"url\\":\\"/aboutguider/\\"}]}"]]},"headers":[],"git":{"createdTime":1682776586000,"updatedTime":1682819783000,"contributors":[{"name":"WLei224","email":"1149630057@qq.com","commits":3}]},"readingTime":{"minutes":1.1,"words":330},"filePathRelative":"collection/Linux.md","localizedDate":"2023年4月29日","excerpt":"<div class=\\"language-cmd line-numbers-mode\\" data-ext=\\"cmd\\"><pre class=\\"language-cmd\\"><code> docker相关命令：\\n \\t#docker pull之后，使用如下命令进行创建和启动容器，因为懒的配置，所以使用默认配置。\\n \\t\\tdocker run -itd --name redis -p 6379:6379 redis\\n \\t#docker ps：查看运行中的CONTAINER\\n \\t#docker进入容器\\n \\t\\tdocker exec -it mymongo /bin/bash\\n \\t#这个是使容器处于docker运行便自启动\\n \\t\\tdocker update redis --restart=always \\n \\t#docker重启命令\\n \\t\\tsystemctl restart docker\\n \\t#容器重启命令\\n \\t\\tdocker restart redis(自己命的名字或者CONTAINER ID)\\n 启动     systemctl start firewalld\\n 关闭     systemctl stop firewalld\\n 查看状态  systemctl status firewalld\\n 查看状态  firewall-cmd --state\\n 开机启用  systemctl enable firewalld\\n 开机禁用  systemctl disable firewalld\\n 查看端口  firewall-cmd --zone=public --list-ports\\n 添加端口  firewall-cmd --add-port=443/tcp --permanent //永久添加443端口,协议为tcp \\n 重新加载  firewall-cmd --reload //重新加载\\n\\n 删除端口  firewall-cmd --zone=public --remove-port=80/tcp --permanent //删除tcp下的80端口\\n\\n \\n\\n 参数介绍：\\n firewall-cmd：是Linux提供的操作firewall的一个工具(注意没有字母“d”)；\\n --permanent：表示设置为持久；\\n --add-port：标识添加的端口\\n --remove-port:标识删除的端口\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div>"}');export{e as data};
